            v-model="slide"
            :interval="10000"
            controls
            indicators
            @sliding-start="onSlideStart"
            @sliding-end="onSlideEnd"
          >
            <b-carousel-slide> Lorem ipsum dolor 1 </b-carousel-slide>

            <b-carousel-slide> Lorem ipsum dolor 2 </b-carousel-slide>

