</template>
<script>
import buttonAnimation from "@/scripts/button";
import animate from "@/scripts/animationFrame";

export default {
  name: "section_2",
  data() {
    return {
      slide: 0,
      sliding: null,
    };
  },
  methods: {
    animationLines(slide, direction) {
      let currentLine;
      let isCross;
      if (direction == true) {
        isCross = this.slide - slide;
        currentLine = document.querySelector(`#line_${this.slide}`);
      } else {
        currentLine = document.querySelector(`#line_${slide}`);
      }

      if (!currentLine) {
        if (isCross == -2) {
          document
            .querySelectorAll(".line")
            .forEach((item) => (item.style.strokeDashoffset = 0));
        } else {
          document
            .querySelectorAll(".line")
            .forEach((item) => (item.style.strokeDashoffset = 160));
        }
        return;
      }
      if (isCross == -2) {
        document
          .querySelectorAll(".line")
          .forEach((item) => (item.style.strokeDashoffset = 0));
      }

      let startPositionCurrentLine = parseInt(
        getComputedStyle(currentLine).strokeDashoffset
      );

      let step = currentLine.getTotalLength();

      animate({
        duration: 1000,
        timing: function (timeFraction) {
          return timeFraction;
        },
        draw: function (progress) {
          if (direction == true) {
            currentLine.style.strokeDashoffset =
              startPositionCurrentLine + step * progress;
          } else {
            currentLine.style.strokeDashoffset =
              startPositionCurrentLine - step * progress;
          }
        },
      });
    },
    calcSliderDirection(slide) {
      let pointer = this.slide - slide;

      if (pointer == -1 || pointer == 2) {
        return false;
      } else if (pointer == 1 || pointer == -2) {
        return true;
      }
    },
    animationCar(slide, direction) {
      const car = this.$refs.car;
      const svg = this.$refs.car_animation;

      let svgHeight = svg.height.animVal.value;
      let carHeight = car.width.animVal.value;
      let step = (svgHeight + carHeight) / 2 - carHeight;
      let startCarPosition = parseInt(
        getComputedStyle(this.$refs.car).transform.split(",")[5]
      );

      let checkTexture = this.slide - slide;

      if (checkTexture == -2 || checkTexture == 2) {
        if (!direction) {
          let test = new Promise((resolve) => {
            animate({
              duration: 500,
              timing: function (timeFraction) {
                return timeFraction;
              },
              draw: function (progress) {
                car.style.transform = `translate(-464px, ${
                  startCarPosition + carHeight * progress
                }px) rotate(-90deg)`;
                if (progress == 1) {
                  resolve();
                }
              },
            });
          });
          test
            .then(() => {
              car.style.transform = `translate(-464px, ${0}px) rotate(-90deg)`;
              startCarPosition = 0;
            })
            .then(() => {
              animate({
                duration: 500,
                timing: function (timeFraction) {
                  return timeFraction;
                },
                draw: function (progress) {
                  car.style.transform = `translate(-464px, ${
                    startCarPosition + carHeight * progress
                  }px) rotate(-90deg)`;
                },
              });
            });
        } else {
          let test2 = new Promise((resolve) => {
            animate({
              duration: 500,
              timing: function (timeFraction) {
                return timeFraction;
              },
              draw: function (progress) {
                car.style.transform = `translate(-464px, ${
                  startCarPosition - carHeight * progress
                }px) rotate(-90deg)`;
                if (progress == 1) {
                  resolve();
                }
              },
            });
          });
          test2
            .then(() => {
              car.style.transform = `translate(-464px, ${538}px) rotate(-90deg)`;
              startCarPosition = 538;
            })
            .then(() => {
              animate({
                duration: 500,
                timing: function (timeFraction) {
                  return timeFraction;
                },
                draw: function (progress) {
                  car.style.transform = `translate(-464px, ${
                    startCarPosition - carHeight * progress
                  }px) rotate(-90deg)`;
                },
              });
            });
        }
      } else {
        animate({
          duration: 1000,
          timing: function (timeFraction) {
            return timeFraction;
          },
          draw: function (progress) {
            if (!direction) {
              car.style.transform = `translate(-464px, ${
                startCarPosition + step * progress
              }px) rotate(-90deg)`;
            } else {
              car.style.transform = `translate(-464px, ${
                startCarPosition - step * progress
              }px) rotate(-90deg)`;
            }
          },
        });
      }
    },
    onSlideStart(slide) {
      let sliderDirection = this.calcSliderDirection(slide);
      this.animationLines(slide, sliderDirection);
      this.animationCar(slide, sliderDirection);
      this.sliding = true;
    },
    onSlideEnd() {
      buttonAnimation();
      this.sliding = false;
    },
  },
};
</script>
